import styled from 'styled-components';
import {NearBlack, Secondary} from './Colors.js'

export default styled.div`
	display: flex;
	flex-flow: row wrap;
	flex-wrap: wrap;
	padding-right: 15px;
  	padding-left: 15px;
  	margin: 0 auto;
  	background-color: ${NearBlack};
  	height: 50vh;
  	border: 1px solid ${Secondary};

  	@media (min-width: 768px) {
    	width: 750px;
	}
	@media (min-width: 992px) {
	    width: 970px;
	}
	@media (min-width: 1200px) {
	    width: 1170px;
	}
`;
